export function SortData(data) {
	const dataArray = data.split('\n');

	const grid = {}
	dataArray.forEach((planet) => {
		const planet_str = planet.split(',');
    const x = parseInt(planet[3])
		const y = parseInt(planet[4])
		if (!grid[planet.x]) {
			grid[planet.x] = {};
		}
		if (!grid[planet.x][planet.y]) {
			grid[planet.x][planet.y] = [];
		}
		grid[planet.x][planet.y].push(planet);
	});

	console.log(grid);

}
